        const url = `https://api.themoviedb.org/3/trending/all/week?api_key=baa2f39af2ebd5604c32fe6a7b3162e5`;
        const res = await fetch(url);
        const resJson = await res.json();
        if (resJson.result) {
            setMlist(resJson.result);
        }
        console.log(resJson.results)
    }
    useEffect(() => {
        trendReq();
    }, [])


    return (
        <div>
            <h1>trending page</h1>
        </div>
    );
}

